```cpp
class Solution {
public:
    int rec(int ind, string &s, set<string>& st, vector<int>& dp)
    {
        if (ind == s.size()) return 0;
        if (dp[ind] != -1) return dp[ind];
        int ans = s.size()-ind;
        for (int i = ind; i < s.size(); i++)
        {
            string temp = s.substr(ind, i-ind+1);
            if (st.find(temp) != st.end())
            {
                ans = min(ans, rec(i+1, s, st, dp));
            }
        }
        return dp[ind] = ans;
    }
    int minExtraChar(string s, vector<string>& dictionary) 
    {
        set<string> st;
        int n = s.size();
        vector<int> dp(n, -1);
        for (auto it: dictionary)
        {
            st.insert(it);
        }
        return rec(0, s, st, dp);
    }
};
```
In the above code, we are applying recursion to find the minimum extra characters. The recursion function takes an index and a string as inputs and returns the minimum number of extra characters left over if we break the string starting from this index. 

The function first checks if we have reached the end of the string. If we have reached the end, it returns 0 as there are no extra characters left.

If the dp[ind] value is not -1, it means it has already been calculated and stored in the dp array. We return the stored value.

We initialize ans to the total number of characters in the string. Then we loop over the remaining characters in the string. For each character, we generate a substring from the current index to the current character. We check if this substring is present in our dictionary. If it is, we recursively call the function with the index of the next character (i+1).

Finally, we return the minimum of ans and the result of the recursive call.
